import React, { useEffect } from 'react'
import io from 'socket.io-client'
import queryString from 'query-string'

const Chat = ({location}) => {

    useEffect(() => {
        const data = queryString.parse(location.search)
        console.log(data)
    })
    return (
        <div>
            Chat
        </div>
    )
}

export default Chat;
